const Waranty = () => {
    return ( 
        <React.Fragment>
        <div className="ui container">
        <div className="ui one column grid">
            <div className=" column">
                <h1 className="ui center aligned header">Waranty</h1>
                <p className="ui center aligned container">E-Lux Electric Bicycles offers one of the best warranties in business. 
                    Front to Back Full coverage for 1 year. Battery-Any issuses first year will be
                    repaired or replaced. Second and third year repaired or prorated if battery nedds replacing.
                    Our batteries are made with top of the line Litium lon cells similar to the cells in the 
                    Tesla. All cells are manufactured by Panasonic, Samsumg , or LG. We use a top quality 
                    brand mane motors made by 8-Fun/Bafang.
                </p>
            </div>
        </div>

        </div>

    </React.Fragment>
     );
}

export default Waranty;
